import { Link } from 'react-router-dom';
import './header.css';

const AppleLogo = () => {
    return (
    <div>
        AppleStore
    </div>
    )
}


export const Header = () => {
  return (
    <div className='header'>
        <div className='wrapper'>
            <Link className='home-cart' to="/"><img src='././images/Apple-logo.png' /></Link>
        </div>
        <div className='header-cart'>
            cart
        </div>
    </div>
  )
}
